      'body' => array(
        'und' => array(
          array(
            'value' => "<h2>Usage with and without login</h2>\r\n\r\n<p><span style=\"font-size:110%\">The user is free to use our service without login, but to access the full functionality, we require the user to login to the system. An account should&nbsp;be requested by clicking on \"Sign -in\" and then new user.&nbsp;It needs to be approved by the administrators. Special rights can be assigned to access private data and additional computation resources.</span></p>\r\n\r\n<p>Logging-in will allow you to receive emails, use up to 500 science windows instead of 50, receive email notifications for jobs that are submitted and completed, receive python API code to reproduce the query and direct simplified contact for feedback.</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda/sign.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"81\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda/sign.png?itok=-97wq6V0\" width=\"480\" /> </a></p>\r\n\r\n<h2><a href=\"https://oda-api.readthedocs.io/en/latest/\" target=\"_blank\">Python API</a></h2>\r\n\r\n<p>If you are familiar with python, you can check the API usage at <a href=\"https://oda-api.readthedocs.io/en/latest/\" target=\"_blank\">this url.</a></p>\r\n\r\n<h2>Complete threads</h2>\r\n\r\n<ul>\r\n\t<li><a href=\"mmoda/integral-spi-acs\" target=\"_self\">Extract a SPI-ACS light curve</a>.</li>\r\n\t<li><a href=\"mmoda/integral-isgri\">ISGRI workflow from web interface.</a></li>\r\n\t<li><a href=\"mmoda/integral-jem-x\">JEM-X workflow from web interface.</a></li>\r\n\t<li><a href=\"mmoda/polar\">Extract light curve for Polar</a></li>\r\n\t<li><a href=\"mmoda/antares\">Extract upper limit on neutrino flux with ANTARES</a></li>\r\n</ul>\r\n\r\n<h2>Some example analysis threads for the web interface</h2>\r\n\r\n<p>We provide some analysis threads for the online analysis using the web interface. They are based on a real case, they are not exhaustive, but they can be used as a base.</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>ISGRI</p>\r\n\r\n\t<ul>\r\n\t\t<li>\r\n\t\t<p><a href=\"mmoda/ibis-isgri-image-new-source\">ISGRI image in a time range</a> looking for a new source.</p>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t<p><a href=\"mmoda/isgri-spectrum\">Extract ISGRI spectrum with a catalog.</a></p>\r\n\t\t</li>\r\n\t\t<li><a href=\"mmoda/isgri-light-curve\">Extract a ISGRI light curve with a catalog.</a></li>\r\n\t\t<li><a href=\"mmoda/extract-isgri-spectrum-without-catalog\">Extract an ISGRI spectrum without a catalog</a> (not recommended).</li>\r\n\t</ul>\r\n\t</li>\r\n\t<li>JEM-X\r\n\t<ul>\r\n\t\t<li><a href=\"mmoda/jem-x-image\">Extract a JEM-X image</a></li>\r\n\t\t<li><a href=\"mmoda/jem-x-spectrum\">Extract a JEM-X spectrum</a></li>\r\n\t\t<li><a href=\"mmoda/jem-x-light-curve\">Extract a JEM-X light curve</a></li>\r\n\t</ul>\r\n\t</li>\r\n</ul>\r\n\r\n<h2>General tasks</h2>\r\n\r\n<ul>\r\n\t<li><a href=\"mmoda/upload-custom-catalog-integral-analysis\">Upload a catalog from file.</a></li>\r\n\t<li><a href=\"mmoda/integral-nrt-data-access\">How to access Near Real Time data.</a></li>\r\n</ul>\r\n\r\n<h2>Known Issues</h2>\r\n\r\n<p>It is not possible to change the Xspec model in the Fit of spectra. However, spectra can be downloaded and fit with another package.</p>\r\n\r\n<p>A source named \"NEW SOURCE\" will not be used in extracting JEM-X spectrua and light curves. It is necessary to name it differently.</p>\r\n\r\n<p>If you submit a job and the error \"Forbidden\" appears, it means that you should logout and login again from the web interface.</p>\r\n",
            'summary' => "<p>We provide some analysis threads for the online analysis page.</p>\r\n",
            'format' => 'full_html',
            'safe_value' => "<h2>Usage with and without login</h2>\n\n<p><span style=\"font-size:110%\">The user is free to use our service without login, but to access the full functionality, we require the user to login to the system. An account should be requested by clicking on \"Sign -in\" and then new user. It needs to be approved by the administrators. Special rights can be assigned to access private data and additional computation resources.</span></p>\n\n<p>Logging-in will allow you to receive emails, use up to 500 science windows instead of 50, receive email notifications for jobs that are submitted and completed, receive python API code to reproduce the query and direct simplified contact for feedback.</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda/sign.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"81\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda/sign.png?itok=-97wq6V0\" width=\"480\" /> </a></p>\n\n<h2><a href=\"https://oda-api.readthedocs.io/en/latest/\" target=\"_blank\">Python API</a></h2>\n\n<p>If you are familiar with python, you can check the API usage at <a href=\"https://oda-api.readthedocs.io/en/latest/\" target=\"_blank\">this url.</a></p>\n\n<h2>Complete threads</h2>\n\n<ul>\n\t<li><a href=\"mmoda/integral-spi-acs\" target=\"_self\">Extract a SPI-ACS light curve</a>.</li>\n\t<li><a href=\"mmoda/integral-isgri\">ISGRI workflow from web interface.</a></li>\n\t<li><a href=\"mmoda/integral-jem-x\">JEM-X workflow from web interface.</a></li>\n\t<li><a href=\"mmoda/polar\">Extract light curve for Polar</a></li>\n\t<li><a href=\"mmoda/antares\">Extract upper limit on neutrino flux with ANTARES</a></li>\n</ul>\n\n<h2>Some example analysis threads for the web interface</h2>\n\n<p>We provide some analysis threads for the online analysis using the web interface. They are based on a real case, they are not exhaustive, but they can be used as a base.</p>\n\n<ul>\n\t<li>\n\t<p>ISGRI</p>\n\n\t<ul>\n\t\t<li>\n\t\t<p><a href=\"mmoda/ibis-isgri-image-new-source\">ISGRI image in a time range</a> looking for a new source.</p>\n\t\t</li>\n\t\t<li>\n\t\t<p><a href=\"mmoda/isgri-spectrum\">Extract ISGRI spectrum with a catalog.</a></p>\n\t\t</li>\n\t\t<li><a href=\"mmoda/isgri-light-curve\">Extract a ISGRI light curve with a catalog.</a></li>\n\t\t<li><a href=\"mmoda/extract-isgri-spectrum-without-catalog\">Extract an ISGRI spectrum without a catalog</a> (not recommended).</li>\n\t</ul>\n\t</li>\n\t<li>JEM-X\n\t<ul>\n\t\t<li><a href=\"mmoda/jem-x-image\">Extract a JEM-X image</a></li>\n\t\t<li><a href=\"mmoda/jem-x-spectrum\">Extract a JEM-X spectrum</a></li>\n\t\t<li><a href=\"mmoda/jem-x-light-curve\">Extract a JEM-X light curve</a></li>\n\t</ul>\n\t</li>\n</ul>\n\n<h2>General tasks</h2>\n\n<ul>\n\t<li><a href=\"mmoda/upload-custom-catalog-integral-analysis\">Upload a catalog from file.</a></li>\n\t<li><a href=\"mmoda/integral-nrt-data-access\">How to access Near Real Time data.</a></li>\n</ul>\n\n<h2>Known Issues</h2>\n\n<p>It is not possible to change the Xspec model in the Fit of spectra. However, spectra can be downloaded and fit with another package.</p>\n\n<p>A source named \"NEW SOURCE\" will not be used in extracting JEM-X spectrua and light curves. It is necessary to name it differently.</p>\n\n<p>If you submit a job and the error \"Forbidden\" appears, it means that you should logout and login again from the web interface.</p>\n",
            'safe_summary' => "<p>We provide some analysis threads for the online analysis page.</p>\n",
          ),
        ),
